import React from 'react';
import axios from 'axios';
import '../../App.css';
import Button from 'react-bootstrap/Button';
import Form from 'react-bootstrap/Form';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import useTeamForm from '../CustomHooks';

const CreateMember = () => {
    const signup = () => {
        axios
            .post('http://localhost:8082/team', inputs)
            .catch(err => console.log('error', err))
    }

    const {inputs, handleInputChange, handleSubmit} = useTeamForm(signup);
    return (
        <Container>
            <Row>
                <Form onSubmit={handleSubmit}>
                <h3>Add Team Member</h3>
                    <Form.Group controlId='name'>
                        <Form.Label>Team Member Name</Form.Label>
                        <Form.Control onChange={handleInputChange} type='text' name='name' placeholder="Enter Name" />
                    </Form.Group>
                    <Form.Group controlId='title'>
                        <Form.Label>Team Member Title</Form.Label>
                        <Form.Control onChange={handleInputChange} type='text' name='title' placeholder="Enter Title" />
                    </Form.Group>
                    <Form.Group controlId='bio'>
                        <Form.Label>Team Member Bio</Form.Label>
                        <Form.Control onChange={handleInputChange} as='textarea' rows='5' name='bio' placeholder="Enter Bio" />
                    </Form.Group>
                    <Form.Group controlId='image'>
                        <Form.Label>Team Member Photo</Form.Label>
                        <Form.Control onChange={handleInputChange} type='text'  name='image' placeholder="Enter Photo Link" />
                    </Form.Group>
                    <Button type='submit'>Submit</Button>
                </Form>
            </Row>
        </Container>
    )
}

export default CreateMember;
